BEGIN TRANSACTION;
DROP TABLE IF EXISTS "django_migrations";
CREATE TABLE IF NOT EXISTS "django_migrations" (
	"id"	integer NOT NULL,
	"app"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"applied"	datetime NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_group_permissions";
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
	"id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_user_groups";
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_user_user_permissions";
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "django_content_type";
CREATE TABLE IF NOT EXISTS "django_content_type" (
	"id"	integer NOT NULL,
	"app_label"	varchar(100) NOT NULL,
	"model"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "django_admin_log";
CREATE TABLE IF NOT EXISTS "django_admin_log" (
	"id"	integer NOT NULL,
	"object_id"	text,
	"object_repr"	varchar(200) NOT NULL,
	"action_flag"	smallint unsigned NOT NULL CHECK("action_flag" >= 0),
	"change_message"	text NOT NULL,
	"content_type_id"	integer,
	"user_id"	integer NOT NULL,
	"action_time"	datetime NOT NULL,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_permission";
CREATE TABLE IF NOT EXISTS "auth_permission" (
	"id"	integer NOT NULL,
	"content_type_id"	integer NOT NULL,
	"codename"	varchar(100) NOT NULL,
	"name"	varchar(255) NOT NULL,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_group";
CREATE TABLE IF NOT EXISTS "auth_group" (
	"id"	integer NOT NULL,
	"name"	varchar(150) NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "auth_user";
CREATE TABLE IF NOT EXISTS "auth_user" (
	"id"	integer NOT NULL,
	"password"	varchar(128) NOT NULL,
	"last_login"	datetime,
	"is_superuser"	bool NOT NULL,
	"username"	varchar(150) NOT NULL UNIQUE,
	"last_name"	varchar(150) NOT NULL,
	"email"	varchar(254) NOT NULL,
	"is_staff"	bool NOT NULL,
	"is_active"	bool NOT NULL,
	"date_joined"	datetime NOT NULL,
	"first_name"	varchar(150) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "django_session";
CREATE TABLE IF NOT EXISTS "django_session" (
	"session_key"	varchar(40) NOT NULL,
	"session_data"	text NOT NULL,
	"expire_date"	datetime NOT NULL,
	PRIMARY KEY("session_key")
);
DROP TABLE IF EXISTS "synet_waterconsumption";
CREATE TABLE IF NOT EXISTS "synet_waterconsumption" (
	"id"	integer NOT NULL,
	"serialNumber"	integer,
	"customer"	varchar(100) NOT NULL,
	"date"	date NOT NULL,
	"collecter"	varchar(20),
	"counter"	varchar(20),
	"finalIndication"	integer NOT NULL,
	"initialIndication"	integer NOT NULL,
	"intermediateIndication"	integer,
	"cubicMeters"	integer,
	"billableCubicMeters"	integer,
	"hydronomistsCubicMeters"	decimal,
	"cost"	decimal,
	"hydronomistsRight"	decimal,
	"paid"	decimal,
	"paymentDate"	date,
	"receivedBy"	varchar(10),
	"receiptNumber"	integer,
	"balance"	decimal,
	"viberMsg"	varchar(200),
	"notes"	text,
	"fields"	varchar(20),
	"olivesNumber"	integer,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_paid";
CREATE TABLE IF NOT EXISTS "synet_paid" (
	"id"	integer NOT NULL,
	"paid"	decimal,
	"paymentDate"	date,
	"receiptNumber"	integer,
	"balance"	decimal,
	"irrigation_id"	bigint,
	"receiver_id"	bigint,
	FOREIGN KEY("irrigation_id") REFERENCES "synet_watercons"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("receiver_id") REFERENCES "synet_receiver"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_receiver";
CREATE TABLE IF NOT EXISTS "synet_receiver" (
	"id"	integer NOT NULL,
	"receiver"	varchar(30) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_counter";
CREATE TABLE IF NOT EXISTS "synet_counter" (
	"id"	integer NOT NULL,
	"collecter"	varchar(20) NOT NULL,
	"counter"	varchar(20),
	"customer_id"	bigint,
	FOREIGN KEY("customer_id") REFERENCES "synet_person"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_field";
CREATE TABLE IF NOT EXISTS "synet_field" (
	"id"	integer NOT NULL,
	"field"	varchar(20),
	"olivesNumber"	integer,
	"customer_id"	bigint NOT NULL,
	FOREIGN KEY("customer_id") REFERENCES "synet_person"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_watercons";
CREATE TABLE IF NOT EXISTS "synet_watercons" (
	"id"	integer NOT NULL,
	"serialNumber"	integer,
	"date"	date NOT NULL,
	"finalIndication"	integer NOT NULL,
	"initialIndication"	integer NOT NULL,
	"intermediateIndication"	integer,
	"cubicMeters"	integer,
	"billableCubicMeters"	integer,
	"hydronomistsCubicMeters"	decimal,
	"cost"	decimal,
	"hydronomistsRight"	decimal,
	"viberMsg"	varchar(200),
	"notes"	text,
	"counter_id"	bigint NOT NULL,
	"customer_id"	bigint NOT NULL,
	"field_id"	bigint,
	"costPerMeter"	decimal,
	FOREIGN KEY("counter_id") REFERENCES "synet_counter"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("customer_id") REFERENCES "synet_person"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("field_id") REFERENCES "synet_field"("id") DEFERRABLE INITIALLY DEFERRED
);
DROP TABLE IF EXISTS "synet_person";
CREATE TABLE IF NOT EXISTS "synet_person" (
	"id"	integer NOT NULL,
	"fathersName"	varchar(100),
	"name"	varchar(100),
	"surname"	varchar(100) NOT NULL,
	"member"	bool NOT NULL,
	"payAsMember"	bool NOT NULL,
	"isActive"	bool NOT NULL,
	"aa"	integer UNIQUE,
	"afm"	varchar(9) UNIQUE,
	"placeΟfΡesidence"	varchar(20),
	"mobilePhone"	varchar(10),
	"notes"	varchar(100),
	PRIMARY KEY("id" AUTOINCREMENT)
);
